package com.hck.zhuanqian.bean;import org.codehaus.jackson.annotate.JsonAutoDetect;import org.codehaus.jackson.annotate.JsonProperty;import org.codehaus.jackson.map.annotate.JsonSerialize;@JsonSerialize(include = JsonSerialize.Inclusion.NON_NULL)@JsonAutoDetect(getterVisibility = JsonAutoDetect.Visibility.NONE, setterVisibility = JsonAutoDetect.Visibility.NONE)public class OrderBean {    /**     *  "timestamp": "2015-09-29 15:05:39.0",            "id": 1,            "content": "提现1个Q币",            "userName": "老科",            "tx": "http://q.qlogo.cn/qqapp/1104810179/EA12C9413EC458A71C7BFF16C97488A6/40",            "chuLi": true     */	@JsonProperty("id")	private int id;	@JsonProperty("content")	private String content;	@JsonProperty("timestamp")	private String time;	@JsonProperty("chuLi")    private boolean isChuLi;	@JsonProperty("tx")	private String tx;	@JsonProperty("userName")	private String userName;		public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getTx() {        return tx;    }    public void setTx(String tx) {        this.tx = tx;    }    public boolean isChuLi() {		return isChuLi;	}	public void setChuLi(boolean isChuLi) {		this.isChuLi = isChuLi;	}	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getContent() {		return content;	}	public void setContent(String content) {		this.content = content;	}	public String getTime() {		return time;	}	public void setTime(String time) {		this.time = time;	}}